import React from 'react';
const DetalleProductos = () => {
    return (
        <div className="containerDetalleProducto">
            <div className="infoProducto">
                <img src="https://storage.googleapis.com/web-oliver/-VitalCrops-DogPro-Adulto-15k.jpg" width="100px" height="100px" className="rounded-circle" alt="prd"/>
            </div>
            <style jsx>{`
                .containerDetalleProducto{
                    position:fixed;
                    height:100vh;
                    background-color:white;
                    width:20%
                }
            `}</style>
        </div>
    );
}
 
export default DetalleProductos;
